import React from "react";
import { useForm } from "react-hook-form";

type Inputs = {
  login: string;
  password: string;
};

const RegisterForm = () => {
  const { register, handleSubmit } = useForm<Inputs>();
  const submitFunc = (data: Inputs) => {
    console.log(data);
  };

  return (
    <>
      <h1>Регистрация</h1>

      <form onSubmit={handleSubmit(submitFunc)}>
        <label className="label">
          Электронная почта
          <input type="text" placeholder="Email" {...register("login", {required: true})} />
        </label>
        <p className="error"></p>
        <label className="label">
          Пароль
          <input type="text" {...register("password")} />
        </label>
        <input type="submit" />
      </form>
    </>
  );
};

export default RegisterForm;
